import React, {Component} from "react";
import TextFields from "../../../../components/textFieldUI/textField";
import Translate from "../../../../Translate";

class SearchItem extends Component {

    render() {

        return (
            <tr>
                <td/>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        value={''}
                        name={'sku'}
                        onChange={event => this.searchProductHandler.bind(this, event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        value={''}
                        name={'name'}
                        onChange={event => this.searchProductHandler.bind(this, event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        value={''}
                        name={'suppliers'}
                        onChange={event => this.searchProductHandler.bind(this, event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        value={''}
                        name={'barcode'}
                        onChange={event => this.searchProductHandler.bind(this, event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        value={''}
                        name={'description'}
                        onChange={event => this.searchProductHandler.bind(this, event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        value={''}
                        name={'active'}
                        onChange={event => this.searchProductHandler.bind(this, event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td/>
            </tr>
        )
    }
}

export default SearchItem
